tle:"Kernvernieuwing",innovationDesc:"PVO keert de veiligheidslogica om: we verlichten het slachtoffer van de noodzaak om pijn uit te leggen en dragen de verantwoordelijkheid voor onmiddellijke ondersteuning over aan de omgeving.",whyTitle:"Waarom #45?",whyDesc:"Een symbolisch nummer gekozen door de maker van het protocol. Fonetisch onderscheidend en onmiskenbaar. het wordt in geen enkele taal verward met andere nummers. #45 is het anker dat de wereld vertelt: 'In deze ruimte spreken we de taal van veiligheid. Je hebt hier geen stem nodig; je hebt ons protocol.'",iconsTitle:"Waarom Deze Iconen?",iconsLead:"Elk icoon is gekozen om directe cognitieve herkenning te maximaliseren. gebaseerd op universeel leren, empirische symboliek en non-verbale communicatiestandaarden.",iconRationale:[{icon:"Paraplu (Logo)",desc:"Vertegenwoordigt individuele en collectieve bescherming. De paraplu beschermt wie eronder staat. universeel symbool van zorg en dekking."},{icon:"Politieagent",desc:"Roept autoriteit en bescherming op. Van kind tot bejaarde, het is een universeel erkende figuur van veiligheid."},{icon:"Waarschuwingsdriehoek",desc:"Universeel symbool van waarschuwing en risico. Aanwezig in verkeers-, industrile en noodsignalering wereldwijd."},{icon:"Noodkruis",desc:"Wereldwijde standaard voor medische noodgevallen. Het gebruikte formaat is niet het rode kruis. uit respect voor het beschermde embleem van het Internationale Rode Kruis."},{icon:"Hand (Stop!)",desc:"Wereldwijd symbool tegen intimidatie. Het 'stop' gebaar is instinctief en cultureel universeel."},{icon:"Hart",desc:"Roept zorg en emotionele ondersteuning op. Directe associatie met warmte, opvang en luisteren."},{icon:"Helpende Handen",desc:"Aangeleerd als AAC (Augmentatieve en Alternatieve Communicatie) symbool voor non-verbale communicatie. Neurodivergente personen leren dit symbool vroeg. wat het makkelijk maakt om hulp te vragen zonder woorden."}],specsTitle:"Technische Specificaties",contrast:"21:1 Contrast",co